import React, {Component} from 'react';
import {Grid, Cell } from 'react-mdl'



class Contacts extends Component {
    render() {
        return ( 
        <div>className="comtact-body"
        <Grid className="contact-grid">
            <Cell> col={6}>half page</Cell>
              <Cell> col={6}>half page</Cell>
              </Grid>
            </div>
        )
    }
}

export default Contacts;
